{% extends 'base.html.twig' %}

{% block title %}inscription{% endblock %}


{% block body %}
<section class=\"container\">
<div class=\"row\">
<div class=\"col\">

<h1>Inscription</h1>

{{ form_start(registrationForm) }}

<fieldset class=\"mb-3\">
<legend>Mon identité</legend>
{{ form_row(registrationForm.nom) }}
{{ form_row(registrationForm.prenom) }}
{{ form_row(registrationForm.email) }}
{{ form_row(registrationForm.sexe) }}
{{ form_row(registrationForm.datenaiss) }}
{{ form_row(registrationForm.photo) }} 
</fieldset>
<fieldset class=\"mb-3\">
<legend>Mes coordonnées</legend>
{{ form_row(registrationForm.adresse) }}
{{ form_row(registrationForm.codepostal) }}
{{ form_row(registrationForm.ville) }}
{{ form_row(registrationForm.telephone) }}

{{ form_row(registrationForm.formedeboxe) }} 




</fieldset>

{{ form_row(registrationForm.plainPassword, {
label: 'Mot de passe'
}) }}
{{ form_row(registrationForm.RGPDConsent) }}

<button type=\"submit\" class=\"btn btn-light btn-lg my-3\">M'inscrire</button>
{{ form_end(registrationForm) }}
</div>
</div>
</section>

{% endblock %}

